to achieve the behaviour of native method "showInfoWindow" you have to do the next steps 

1- add this function to AirMapInterface 
`void showInfoContent(AirMapMarker marker);`

2- Override showInfoContent in WebViewMapFragment 

```
@Override public void showInfoContent(AirMapMarker marker) {

      String d = webView.getUrl();
      webView.loadUrl(
              String.format(Locale.US, "javascript:if(%1$d in infoWindowContent){\n" +
                      "        infoWindow = new google.maps.InfoWindow({\n" +
                      "            content: infoWindowContent[%1$d]\n" +
                      "        });\n" +
                      "        infoWindow.open(map, markers[%1$d]);\n" +
                      "        AirMapView.defaultInfoWindowClick(%1$d);\n" +
                      "        \n" +
                      "    }", marker.getId()));
  }
```

3- Override showInfoContent in NativeGoogleMapFragment

```
@Override
    public void showInfoContent(AirMapMarker marker) {
        Marker nativeMarker = marker.getMarker();
        nativeMarker.showInfoWindow();
    }
```

finally call showInfoContent  
as my needed i call it in WebViewMapFragment  into addMarker function 

```
@Override public void addMarker(AirMapMarker marker) {
    LatLng latLng = marker.getLatLng();
    markers.put(marker.getId(), marker);

      String d = webView.getUrl();
    webView.loadUrl(
        String.format(Locale.US, "javascript:addMarkerWithId(%1$f, %2$f, %3$d, '%4$s', '%5$s', %6$b);",
            latLng.latitude, latLng.longitude, marker.getId(), marker.getTitle(),
            marker.getSnippet(), marker.getMarkerOptions().isDraggable()));

      showInfoContent(marker);
  }
```

